import React from "react";
import S from "./Card.module.css";

function Card({ breeds }) {
  return (
    <div className={S.container}>
      {breeds.map((e) => {
        return (
          <div className={S.card} key={e.n}>
            <h2>{e.name}</h2>
            <span>{e.weight}</span>
          </div>
        );
      })}
    </div>
  );
}
export default Card;
